import React, { Component } from 'react';
import Nav from './Nav';

export default class Login extends Component {
    state = {
        username: "",
        password: ""
    }
    render(){
        return(
            <div>
                <header className="header">
                <Nav />
                <div className="form-container">
                    <form className='form'>
                    <h1>Login</h1>
                        <input className="form-input" placeholder="Username" value={this.state.username} onChange={this.changeHandler}></input>
                        <br></br>
                        <input className="form-input" placeholder="Password" value={this.state.password} onChange={this.changeHandler}></input>
                        <br></br>
                        <button className='form-submit'>Login</button>
                    </form>
                    </div>
                </header>
            </div>
        )
    }
}
